import React, { useState } from 'react';
import eyesData from './eyes.js';

const App = ({ CharacterPart,  CharacterSelector,  eyesData}) => {
const rr = eyesData;
const [eyes, setEyes] = React.useState(null);
const [lips, setLips] = React.useState(null);
const onClickEyes = (item) => {
  setEyes(item)
}
  return (
    <main className="mainWrapper">
      <CharacterPart lips = {lips}/>
      <CharacterSelector eyesData = {eyesData} onClickEyes = {onClickEyes} />
    </main>
  );
}

export default App;
